435\u043f\u043b\u0430\u0432\u0430\u0442\u0435\u043b\u0438 \u043e\u0442\u043a\u0440\u044b\u043b\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B8%D1%85%D0%B8%D0%B9_%D0%BE%D0%BA%D0%B5%D0%B0%D0%BD\" title=\"\u0422\u0438\u0445\u0438\u0439 \u043e\u043a\u0435\u0430\u043d\">\u0422\u0438\u0445\u043e\u043c \u043e\u043a\u0435\u0430\u043d\u0435<\/a>, \u0432 972 \u043a\u0438\u043b\u043e\u043c\u0435\u0442\u0440\u0430\u0445 \u043a \u0437\u0430\u043f\u0430\u0434\u0443 \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BA%D0%B2%D0%B0%D0%B4%D0%BE%D1%80\" title=\"\u042d\u043a\u0432\u0430\u0434\u043e\u0440\">\u042d\u043a\u0432\u0430\u0434\u043e\u0440\u0430<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D0%BB%D0%B0%D0%BF%D0%B0%D0%B3%D0%BE%D1%81%D1%81%D0%BA%D0%B8%D0%B5_%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%B2%D0%B0\" class=\"mw-redirect\" title=\"\u0413\u0430\u043b\u0430\u043f\u0430\u0433\u043e\u0441\u0441\u043a\u0438\u0435 \u043e\u0441\u0442\u0440\u043e\u0432\u0430\">\u0413\u0430\u043b\u0430\u043f\u0430\u0433\u043e\u0441\u0441\u043a\u0438\u0435 \u043e\u0441\u0442\u0440\u043e\u0432\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1710_%D0%B3%D0%BE%D0%B4\" title=\"1710 \u0433\u043e\u0434\">1710<\/a>&#160;\u2014 \u0412\u044b\u0448\u043b\u0430 \u0432 \u0441\u0432\u0435\u0442 \u043f\u0435\u0440\u0432\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BD%D0%B8%D0%B3%D0%BE%D0%BF%D0%B5%D1%87%D0%B0%D1%82%D0%B0%D0%BD%D0%B8%D0%B5\" title=\"\u041a\u043d\u0438\u0433\u043e\u043f\u0435\u0447\u0430\u0442\u0430\u043d\u0438\u0435\">\u043f\u0435\u0447\u0430\u0442\u043d\u0430\u044f<\/a> \u0433\u0435\u043e\u0433\u0440\u0430\u0444\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043a\u043d\u0438\u0433\u0430 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D1%81%D1%81%D0%BA%D0%B8%D0%B9_%D1%8F%D0%B7%D1%8B%D0%BA\" title=\"\u0420\u0443\u0441\u0441\u043a\u0438\u0439 \u044f\u0437\u044b\u043a\">\u0440\u0443\u0441\u0441\u