43d\u0430 \u043d\u0430 \u0434\u0432\u0435 \u0447\u0430\u0441\u0442\u0438&#160;\u2014 \u0421\u0435\u0432\u0435\u0440\u043d\u0443\u044e \u0438 \u042e\u0436\u043d\u0443\u044e&#160;\u2014 \u0441 \u0441\u043e\u0431\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u043c\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%BB%D0%B0%D0%BC%D0%B5%D0%BD%D1%82\" title=\"\u041f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\">\u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\u0430\u043c\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1924_%D0%B3%D0%BE%D0%B4\" title=\"1924 \u0433\u043e\u0434\">1924<\/a>&#160;\u2014 \u0423\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B8%D0%BF%D0%BB%D0%BE%D0%BC%D0%B0%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B5_%D0%BE%D1%82%D0%BD%D0%BE%D1%88%D0%B5%D0%BD%D0%B8%D1%8F\" title=\"\u0414\u0438\u043f\u043b\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u044f\">\u0434\u0438\u043f\u043b\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u044f<\/a> \u043c\u0435\u0436\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D1%8E%D0%B7_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%B8%D1%85_%D0%A1%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D1%85_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA\" title=\"\u0421\u043e\u044e\u0437 \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0445 \u0421\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\">\u0421\u0421\u0421\u0420<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D1%80%D0%B2%D0%B5%D0%B3%D0%B8%D1%8F\" title=\"\u041d\u043e\u0440\u0432\u0435\u0433\u0438\u044f\">\u041d\u043e\u0440\u0432\u0435\u0433\u0438\u0435\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1939_%D0%B3%D0%BE%D0%B4\" title=\"1939 \u0433\u043e\u0434\">1939<\/a>&#160;\u2014 \u041d\u0430\u0447\u0430\u043b\u043e\u0441\u044c \u0440\u0435\u0433\u0443\u043b\u044f\u0440\u043d\u043e\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D0%BB%D0%B5%D0%B2%D0%B8%D0%B4%D0%B5%D0%BD%D0%B8%D0%B5\" title=\"\u0422\u0435\u043b\u0435\u0432\u0438\u0434\u0435\u043d\u0438\u0435\">\u0442\u0435\u043b\u0435\u0432\u0438\u0437\u0438\u043e\u043d\u043d\u043e\u0435 \u0432\u0435\u0449\u0430\u043d\u0438\u0435<\/a> \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B0%D0%B1%D0%BE%D0%BB%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D1%82%D0%B5%D0%BB%D0%B5%D1%86%D0%B5%D0%BD%D1%82%D1%80\" title=\"\u0428\u0430\u0431\u043e\u043b\u043e\u0432\u0441\u043a\u0438\u0439 \u0442\u0435\u043b\u0435\u0446\u0435\u043d\u0442\u0440\">\u0428\u0430\u0431\u043e\u043b\u043e\u0432\u0441\u043a\u043e\u0433\u043e \u0442\u0435\u043b\u0435\u0446\u0435\u043d\u0442\u0440\u0430<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> . \u041a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e \u0442\u0435\u043b\u0435\u0432\u0438\u0437\u043e\u0440\u043e\u0432 \u0432 \u041c\u043e\u0441\u043a\u0432\u0435 \u0442\u043e\u0433\u0434\u0430 \u0435\u0434\u0432\u0430 \u043f\u0440\u0435\u0432\u044b\u0448\u0430\u043b\u043e \u0441\u043e\u0442\u043d\u044e, \u0430 \u0441\u0438\u0433\u043d\u0430\u043b \u043f\u0435\u0440\u0435\u0434\u0430\u0432\u0430\u043b\u0441\u044f \u0441\u043e \u0437\u043d\u0430\u043c\u0435\u043d\u0438\u0442\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D1%83%D1%85%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%B1%D0%B0%D1%88%D0%BD%D1%8F\" title=\"\u0428\u0443\u0445\u043e\u0432\u0441\u043a\u0430\u044f \u0431\u0430\u0448\u043d\u044f\">\u0428\u0443\u0445\u043e\u0432\u0441\u043a\u043e\u0439 \u0431\u0430\u0448\u043d\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1939_%D0%B3%D0%BE%D0%B4\" title=\"1939 \u0433\u043e\u0434\">1939<\/a>&#160;\u2014 \u041e\u0442\u043a\u0440\u044b\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/XVIII_%D1%81%D1%8A%D0%B5%D0%B7%D0%B4_%D0%92%D0%9A%D0%9F(%D0%B1)\" title=\"XVIII \u0441\u044a\u0435\u0437\u0434 \u0412\u041a\u041f(\u0431)\">XVIII \u0441\u044a\u0435\u0437\u0434 \u0412\u041a\u041f(\u0431)<\/a>, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043a\u043e\u043d\u0441\u0442\u0430\u0442\u0438\u0440\u043e\u0432\u0430\u043b \u043f\u043e\u0431\u0435\u0434\u0443 \u0441\u043e\u0446\u0438\u0430\u043b\u0438\u0437\u043c\u0430 \u0432 \u0421\u0421\u0421\u0420 \u0438 \u043f\u0440\u0438\u043d\u044f\u043b \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u043e \u00ab\u043f\u043e\u0441\u0442\u0435\u043f\u0435\u043d\u043d\u043e\u043c \u043f\u0435\u0440\u0435\u0445\u043e\u0434\u0435 \u043e\u0442 \u0441\u043e\u0446\u0438\u0430\u043b\u0438\u0437\u043c\u0430 \u043a \u043a\u043e\u043c\u043c\u0443\u043d\u0438\u0437\u043c\u0443\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1943_%D0%B3%D0%BE%D0%B4\" title=\"1943 \u0433\u043e\u0434\">1943<\/a>&#160;\u2014 \u041d\u0430\u0447\u0430\u0442\u044b \u0440\u0430\u0431\u043e\u0442\u044b \u043f\u043e \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%B4%D0%B5%D1%80%D0%BD%D0%BE%D0%B5_%D0%BE%D1%80%D1%83%D0%B6%D0%B8%D0%B5\" title=\"\u042f\u0434\u0435\u0440\u043d\u043e\u0435 \u043e\u0440\u0443\u0436\u0438\u0435\">\u044f\u0434\u0435\u0440\u043d\u043e\u0433\u043e \u043e\u0440\u0443\u0436\u0438\u044f<\/a> \u0432 \u0421\u0421\u0421\u0420.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1945_%D0%B3%D0%BE%D0%B4\" title=\"1945 \u0433\u043e\u0434\">1945<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BC%D0%B1%D0%B0%D1%80%D0%B4%D0%B8%D1%80%D0%BE%D0%B2%D0%BA%D0%B0_%D0%A2%D0%BE%D0%BA%D0%B8%D0%BE_10_%D0%BC%D0%B0%D1%80%D1%82%D