ddy Cannon (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">Explosive Freddy Cannon<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1964_%D0%B3%D0%BE%D0%B4\" title=\"1964 \u0433\u043e\u0434\">1964<\/a>&#160;\u2014 \u0412 \u0440\u0430\u0439\u043e\u043d\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%B3%D0%B4%D0%B5%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u041c\u0430\u0433\u0434\u0435\u0431\u0443\u0440\u0433\">\u041c\u0430\u0433\u0434\u0435\u0431\u0443\u0440\u0433\u0430<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%94%D0%B5%D0%BC%D0%BE%D0%BA%D1%80%D0%B0%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u0413\u0435\u0440\u043c\u0430\u043d\u0441\u043a\u0430\u044f \u0414\u0435\u043c\u043e\u043a\u0440\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u0413\u0414\u0420<\/a>) \u0431\u044b\u043b \u0441\u0431\u0438\u0442 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BC%D0%BE%D0%BB%D1%91%D1%82-%D1%80%D0%B0%D0%B7%D0%B2%D0%B5%D0%B4%D1%87%D0%B8%D0%BA\" title=\"\u0421\u0430\u043c\u043e\u043b\u0451\u0442-\u0440\u0430\u0437\u0432\u0435\u0434\u0447\u0438\u043a\">\u0421\u0430\u043c\u043e\u043b\u0451\u0442-\u0440\u0430\u0437\u0432\u0435\u0434\u0447\u0438\u043a<\/a> RB-66.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1967_%D0%B3%D0%BE%D0%B4\" title=\"1967 \u0433\u043e\u0434\">1967<\/a>&#160;\u2014 \u0410\u0432\u0438\u0430\u0446\u0438\u044f \u0421\u0428\u0410 \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u043b\u0430 \u043f\u0435\u0440\u0432\u044b\u0439 \u0441 \u043d\u0430\u0447\u0430\u043b\u0430 \u043c\u0430\u0441\u0441\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u0445 \u0431\u043e\u043c\u0431\u0430\u0440\u0434\u0438\u0440\u043e\u0432\u043e\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D0%BC%D0%BE%D0%BA%D1%80%D0%B0%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0_%D0%92%D1%8C%D0%B5%D1%82%D0%BD%D0%B0%D0%BC\" title=\"\u0414\u0435\u043c\u043e\u043a\u0440\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430 \u0412\u044c\u0435\u0442\u043d\u0430\u043c\">\u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0433\u043e \u0412\u044c\u0435\u0442\u043d\u0430\u043c\u0430<\/a> \u043d\u0430\u043b\u0451\u0442 \u043d\u0430 \u0433\u043b\u0430\u0432\u043d\u044b\u0435 \u043f\u0440\u043e\u043c\u044b\u0448\u043b\u0435\u043d\u043d\u044b\u0435 \u043e\u0431\u044a\u0435\u043a\u0442\u044b \u0441\u0442\u0440\u0430\u043d\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1970_%D0%B3%D0%BE%D0%B4\" title=\"1970 \u0433\u043e\u0434\">1970<\/a>&#160;\u2014 \u0421 \u0446\u0435\u043b\u044c\u044e \u043f\u0440\u0435\u043a\u0440\u0430\u0442\u0438\u0442\u044c \u0442\u0435\u043e\u043b\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u0431\u0440\u043e\u0436\u0435\u043d\u0438\u044f \u0438 \u0441\u0442\u0438\u043c\u0443\u043b\u0438\u0440\u043e\u0432\u0430\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BC%D0%B8%D0%B3%D1%80%D0%B0%D1%86%D0%B8%D1%8F\" title=\"\u042d\u043c\u0438\u0433\u0440\u0430\u0446\u0438\u044f\">\u044d\u043c\u0438\u0433\u0440\u0430\u0446\u0438\u044e<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B7%D1%80%D0%B0%D0%B8%D0%BB%D1%8C\" title=\"\u0418\u0437\u0440\u0430\u0438\u043b\u044c\">\u0418\u0437\u0440\u0430\u0438\u043b\u044c<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BD%D0%B5%D1%81%D1%81%D0%B5%D1%82\" title=\"\u041a\u043d\u0435\u0441\u0441\u0435\u0442\">\u041a\u043d\u0435\u0441\u0441\u0435\u0442<\/a> \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u043b \u0441\u0447\u0438\u0442\u0430\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B2%D1%80%D0%B5%D0%B8\" title=\"\u0415\u0432\u0440\u0435\u0438\">\u0435\u0432\u0440\u0435\u0435\u043c<\/a> \u043d\u0435 \u0442\u043e\u043b\u044c\u043a\u043e \u00ab\u0440\u043e\u0436\u0434\u0451\u043d\u043d\u043e\u0433\u043e \u043e\u0442 \u0435\u0432\u0440\u0435\u0439\u043a\u0438\u00bb, \u043d\u043e \u0438 \u0432\u0441\u044f\u043a\u043e\u0433\u043e \u043d\u0435\u0435\u0432\u0440\u0435\u044f, \u043f\u0440\u0438\u043d\u044f\u0432\u0448\u0435\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%83%D0%B4%D0%B0%D0%B8%D0%B7%D0%BC\" title=\"\u0418\u0443\u0434\u0430\u0438\u0437\u043c\">\u0438\u0443\u0434\u0430\u0438\u0437\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1976_%D0%B3%D0%BE%D0%B4\" title=\"1976 \u0433\u043e\u0434\">1976<\/a>&#160;\u2014 \u041d\u0430\u0447\u0430\u043b\u0430\u0441\u044c \u043f\u0435\u0440\u0432\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D1%80%D0%BE%D0%B2%D0%BE%D0%B9_%D0%BE%D0%BA%D0%B5%D0%B0%D0%BD\" title=\"\u041c\u0438\u0440\u043e\u0432\u043e\u0439 \u043e\u043a\u0435\u0430\u043d\">\u043e\u043a\u0435\u0430\u043d\u0441\u043a\u0430\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%96%D0%B5%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B4%D0%B8%D0%BD%D0%BE%D1%87%D0%BD%D0%B0%D1%8F_%D0%BA%D1%80%D1%83%D0%B3%D0%BE%D1%81%D0%B2%D0%B5%D1%82%D0%BA%D0%B0&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0416\u0435\u043d\u0441\u043a\u0430\u044f \u043e\u0434\u0438\u043d\u043e\u0447\u043d\u0430\u044f \u043a\u0440\u0443\u0433\u043e\u0441\u0432\u0435\u0442\u043a\u0430 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0436\u0435\u043d\u0441\u043a\u0430\u044f \u043e\u0434\u0438\u043d\u043e\u0447\u043d\u0430\u044f \u043a\u0440\u0443\u0433\u043e\u0441\u0432\u0435\u0442\u043a\u0430<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%9A%D1%80%D0%B8%D1%81%D1%82%D0%B8%D0%BD%D0%B0_%D0%A5%D0%BE%D0%B9%D0%BD%D0%BE%D0%B2%D1%81%D0%BA%D0%B0&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u041a\u0440\u0438\u0441\u0442\u0438\u043d\u0430 \u0425\u043e\u0439\u043d\u043e\u0432\u0441\u043a\u0430 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u041a\u0440\u0438\u0441\u0442\u0438\u043d\u0430 \u0425\u043e\u0439\u043d\u043e\u0432\u0441\u043a\u0430<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BB%D1%8C%D1%88%D0%B0\" title=\"\u041f\u043e\u043b\u044c\u0448\u0430\">\u041f\u043e\u043b\u044c\u0448\u0430<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1977_%D0%B3%D0%BE%D0%B4\" title=\"1977 \u0433\u043e\u0434\">1977<\/a>&#160;\u2014 \u041d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u0433\u0440\u0443\u043f\u043f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%81%D1%82%D1%80%D0%BE%D0%BD%D0%BE%D0%BC\" title=\"\u0410\u0441\u0442\u0440\u043e\u043d\u043e\u043c\">\u0430\u0441\u0442\u0440\u043e\u043d\u043e\u043c\u043e\u0432<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u0432\u0441\u0442\u0440\u0430\u043b\u0438\u044f\">\u0410\u0432\u0441\u0442\u0440\u0430\u043b\u0438\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0418\u043d\u0434\u0438\u044f\">\u0418\u043d\u0434\u0438\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%B6%D0%BD%D0%BE-%D0%90%D1%84%D1%80%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u042e\u0436\u043d\u043e-\u0410\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u042e\u0410\u0420<\/a> \u043e\u0442\u043a\u0440\u044b\u043b\u0438 \u043a\u043e\u043b\u044c\u0446\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D1%80%D0%B0%D0%BD_(%D0%BF%D0%BB%D0%B0%D0%BD%D0%B5%D1%82%D0%B0)\" title=\"\u0423\u0440\u0430\u043d (\u043f\u043b\u0430\u043d\u0435\u0442\u0430)\">\u0423\u0440\u0430\u043d\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1982_%D0%B3%D0%BE%D0%B4\" title=\"1982 \u0433\u043e\u0434\">1982<\/a>&#160;\u2014 \u0420\u0435\u0434\u043a\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B0%D0%B4_%D0%BF%D0%BB%D0%B0%D0%BD%D0%B5%D1%82\" title=\"\u041f\u0430\u0440\u0430\u0434 \u043f\u043b\u0430\u043d\u0435\u0442\">\u043f\u0430\u0440\u0430\u0434 \u043f\u043b\u0430\u043d\u0435\u0442<\/a>&#160;\u2014 \u0432\u0441\u0435 \u0434\u0435\u0432\u044f\u0442\u044c \u043f\u043b\u0430\u043d\u0435\u0442 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D1%80%D0%BA%D1%83%D1%80%D0%B8%D0%B9\" title=\"\u041c\u0435\u0440\u043a\u0443\u0440\u0438\u0439\">\u041c\u0435\u0440\u043a\u0443\u0440\u0438\u0439<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BD%D0%B5%D1%80%D0%B0\" title=\"\u0412\u0435\u043d\u0435\u0440\u0430\">\u0412\u0435\u043d\u0435\u0440\u0430<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B5%D0%BC%D0%BB%D1%8F\" title=\"\u0417\u0435\u043c\u043b\u044f\">\u0417\u0435\u043c\u043b\u044f<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D1%81\" title=\"\u041c\u0430\u0440\u0441\">\u041c\u0430\u0440\u0441<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%BF%D0%B8%D1%82%D0%B5%D1%80\" title=\"\u042e\u043f\u0438\u0442\u0435\u0440\">\u042e\u043f\u0438\u0442\u0435\u0440<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D1%82%D1%83%D1%80%D0%BD\" title=\"\u0421\u0430\u0442\u0443\u0440\u043d\">\u0421\u0430\u0442\u0443\u0440\u043d<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D1%80%D0%B0%D0%BD_(%D0%BF%D0%BB%D0%B0%D0%BD%D0%B5%D1%82%D0%B0)\" title=\"\u0423\u0440\u0430\u043d (\u043f\u043b\u0430\u043d\u0435\u0442\u0430)\">\u0423\u0440\u0430\u043d<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B5%D0%BF%D1%82%D1%83%D0%BD\" title=\"\u041d\u0435\u043f\u0442\u0443\u043d\">\u041d\u0435\u043f\u0442\u0443\u043d<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BB%D1%83%D1%82%D0%BE%D0%BD\" title=\"\u041f\u043b\u0443\u0442\u043e\u043d\">\u041f\u043b\u0443\u0442\u043e\u043d<\/a>) \u0441\u043e\u0431\u0440\u0430\u043b\u0438\u0441\u044c \u043f\u043e \u043e\u0434\u043d\u0443 \u0441\u0442\u043e\u0440\u043e\u043d\u0443 \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%BB%D0%BD%D1%86%D0%B5\" title=\"\u0421\u043e\u043b\u043d\u0446\u0435\">\u0421\u043e\u043b\u043d\u0446\u0430<\/a> \u0432 \u0441\u0435\u043a\u0442\u043e\u0440\u0435 \u0441 \u0443\u0433\u043b\u043e\u043c 95 \u0433\u0440\u0430\u0434\u0443\u0441\u043e\u0432  (\u0442\u043e \u0435\u0441\u0442\u044c, \u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u0430\u044f \u0440\u0430\u0437\u043d\u043e\u0441\u0442\u044c \u0433\u0435\u043b\u0438\u043e\u0446\u0435\u043d\u0442\u0440\u0438\u0447\u0435\u0441\u043a\u0438\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BA%D0%BB%D0%B8%D0%BF%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D1%81%D0%B8%D1%81%D1%82%D0%B5%D0%BC%D0%B0_%D0%BA%D0%BE%D0%BE%D1%80%D0%B4%D0%B8%D0%BD%D0%B0%D1%82\" title=\"\u042d\u043a\u043b\u0438\u043f\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0441\u0438\u0441\u0442\u0435\u043c\u0430 \u043a\u043e\u043e\u0440\u0434\u0438\u043d\u0430\u0442\">\u044d\u043a\u043b\u0438\u043f\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0434\u043e\u043b\u0433\u043e\u0442<\/a> \u043f\u043b\u0430\u043d\u0435\u0442 \u0441\u043e\u0441\u0442\u0430\u0432\u0438\u043b\u0430 95 \u0433\u0440\u0430\u0434\u0443\u0441\u043e\u0432).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1987_%D0%B3%D0%BE%D0%B4\" title=\"1987 \u0433\u043e\u0434\">1987<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%82%D0%B8%D0%BA%D0%B0%D0%BD\" title=\"\u0412\u0430\u0442\u0438\u043a\u0430\u043d\">\u0412\u0430\u0442\u0438\u043a\u0430\u043d\u0435<\/a> \u043e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043d\u0430 \u00ab\u041f\u0430\u043c\u044f\u0442\u043a\u0430 \u043e\u0431 \u0438\u0441\u0442\u043e\u043a\u0430\u0445 \u0447\u0435\u043b\u043e\u0432\u0435\u0447\u0435\u0441\u043a\u043e\u0439 \u0436\u0438\u0437\u043d\u0438 \u0438 \u0432\u0435\u043b\u0438\u0447\u0438\u0438 \u0434\u0435\u0442\u043e\u0440\u043e\u0436\u0434\u0435\u043d\u0438\u044f: \u043e\u0442\u0432\u0435\u0442\u044b \u043d\u0430 \u043d\u0435\u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0432\u043e\u043f\u0440\u043e\u0441\u044b \u0441\u0435\u0433\u043e\u0434\u043d\u044f\u0448\u043d\u0435\u0433\u043e \u0434\u043d\u044f\u00bb, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u043e\u0441\u0443\u0436\u0434\u0435\u043d\u044b \u043c\u0435\u0442\u043e\u0434\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BA%D1%81%D1%82%D1%80%D0%B0%D0%BA%D0%BE%D1%80%D0%BF%D0%BE%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE%D0%B5_%D0%BE%D0%BF%D0%BB%D0%BE%D0%B4%D0%BE%D1%82%D0%B2%D0%BE%D1%80%D0%B5%D0%BD%D0%B8%D0%B5\" title=\"\u042d\u043a\u0441\u0442\u0440\u0430\u043a\u043e\u0440\u043f\u043e\u0440\u0430\u043b\u044c\u043d\u043e\u0435 \u043e\u043f\u043b\u043e\u0434\u043e\u0442\u0432\u043e\u0440\u0435\u043d\u0438\u0435\">\u044d\u043a\u0441\u0442\u0440\u0430\u043a\u043e\u0440\u043f\u043e\u0440\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u043e\u043f\u043b\u043e\u0434\u043e\u0442\u0432\u043e\u0440\u0435\u043d\u0438\u044f<\/a> \u0438 \u0441\u043e\u0434\u0435\u0440\u0436\u0430\u043b\u0438\u0441\u044c \u043f\u0440\u0438\u0437\u044b\u0432\u044b \u0437\u0430\u043f\u0440\u0435\u0442\u0438\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BA%D1%81%D0%BF%D0%B5%D1%80%D0%B8%D0%BC%D0%B5%D0%BD%D1%82\" title=\"\u042d\u043a\u0441\u043f\u0435\u0440\u0438\u043c\u0435\u043d\u0442\">\u044d\u043a\u0441\u043f\u0435\u0440\u0438\u043c\u0435\u043d\u0442\u044b<\/a> \u0441 \u0436\u0438\u0432\u044b\u043c\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BC%D0%B1%D1%80%D0%B8%D0%BE%D0%BD\" title=\"\u042d\u043c\u0431\u0440\u0438\u043e\u043d\">\u044d\u043c\u0431\u0440\u0438\u043e\u043d\u0430\u043c\u0438<\/a> \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430.<\/li><\/ul><h2>"}